pragma solidity >= 0.8.0 < 0.9.0;
import "https://github.com/OpenZeppelin/openzeppelin-contracts/blob/master/contracts/access/Ownable.sol";

contract Allowance is Ownable{
    
    mapping(address=> uint) public allowance;
    event AllowanceChanged(address indexed fromwhom, address indexed towhom, uint oldAmount, uint newAmount );

    function addAllowance(address _who,uint amount) public  onlyOwner{
        emit AllowanceChanged(msg.sender,_who,allowance[_who],amount);
        allowance[_who]=amount;
    }

    modifier ownerOrAllowed(uint amount){
        require(_checkOwner() | allowance[msg.sender] >= amount,"You are not allowed" );
        _;
    }
    function reduceAllowance(address _who,uint amount) internal{
        emit AllowanceChanged ( msg.sender,_who, allowance[_who],allowance[_who] - amount);
        allowance[_who]-=amount;

    }
}
contract SimpleWallet is Allowance {
  
    function withdrawMoney(address payable _to, uint amount)public ownerOrAllowed(amount){
        require(amount <= address(this).balance, "There are not enough funds stored in the smart contract");
        if(msg.sender!=owner()){
            reduceAllowance(msg.sender,amount);
        }            
        
        _to.transfer(amount);
    }

   

    receive() external payable{

    }
}

